import React from "react";
import './Contact.css';
const Contact = () => {
    return (
    <>
    <h1 className="contact-title">My Contacts</h1>
    <a className ="btn" href="https://www.linkedin.com/in/jason-cheung-33337a206/"><i class="fa-brands fa-linkedin-in" className="logo"></i></a>
    <i class="fa fa-envelope" className="logo" aria-hidden="true"></i>
    </>);
  };

export default Contact;
